##Product compositions##
DubbelFrisss Pineapple-Mango:
water, fruit juices from concentrated fruit juices, (apple, pineapple 1%, mango 1%), citric acid, aroma, sugar, carbonic acid (< 0,1%). Total sugars/sodium (per 100gr): 8.6gr/0.001gr.

DubbelFrisss Apple-Blueberry:
water, fruit juices from concentrated fruit juices, (apple 11%, blackcurrant 3%, aronia berry), citric acid, aroma, sugar, carbonic acid (< 0,1%). Total sugars/sodium (per 100 gr): 8.5gr/0.001gr.

DubbelFrisss Apple-Peach:
water, fruit juices from concentrated fruit juices, (apple 14%, peach 1.1%), citric acid, aroma, sugar, carbonic acid (< 0,1%). Total sugars/sodium (per 100gr): 8.6gr/0.001gr.

DubbelFrisss Orange-Tangerine:
water, fruit juices from concentrated fruit juices, (orange 7%, apple, tangerine 2.4%), citric acid, aroma, sugar, carbonic acid (< 0,1%). Total sugars/sodium (per 100 gr): 8.6gr/0.001gr

Optimel general:
Yogurt from skimmed milk, 5% fruit juices (see below), corn starch, calcium, sucralose. Proteins/Sugars/Sodium/Calcium (per 100gr): 3.1g/3.6g/0.04gr/120mg. Vitamins from the B complex (B2: 0,21mg; B6: 0,21mg; B12: 0,38 microgr).

Optimel Raspberry: apple, 1% raspberry, aronia berry, lemon
Optimel Coconut: apple, lemon, 1% coconut
Optimel Lime: apple, 0.5% lemon, 0.5% lime
Optimel Orange-Cinnamon: apple, 1% orange, cinnamon

##General procedure per trial##
Period	Description
warning_star	Warning for upcomming flavour stimulus using a star on the screen (2s)
taste_and_swallow	Instruction to first taste (3.5s) and then swallow (4s) the 2ml flavour stimulus
judge	Passivily judge the stimulus (22.5s) while watching a fixation cross.
rate	Actively rate the stimulus on a 7 point liking scale (self paced)
rinse	Rinsing procedure to rinse the palate using 2ml of a 5% artificial saliva solution (29s)

##Stimulus labels##
All stimulus screens (except "warning_star" and "rinse") are coded as a combination of the general procedure and Flavour product as follows:

